import React from 'react';

class Component extends React.Component {
  render() {
    return (
      <div>
      <h1>Cecília R Martins</h1>
      <p>Uma breve descrição sobre mim... eu gosto de gatos </p>
      </div>
    )
  }
}
export default Component;
